CREATE VIEW `qlcvsd_user_vai_tro`  AS SELECT `t`.`id` AS `id`, `t`.`username` AS `username`, `t`.`password_hash` AS `password_hash`, `t`.`password_reset_token` AS `password_reset_token`, `t`.`email` AS `email`, `t`.`auth_key` AS `auth_key`, `t`.`status` AS `status`, `t`.`created_at` AS `created_at`, `t`.`updated_at` AS `updated_at`, `t`.`password` AS `password`, `t`.`hoten` AS `hoten`, `t`.`dien_thoai` AS `dien_thoai`, `t`.`anhdaidien` AS `anhdaidien`, `t`.`VIP` AS `VIP`, `t`.`vi_dien_tu` AS `vi_dien_tu`, `t`.`hoat_dong` AS `hoat_dong`, `t`.`birth_day` AS `birth_day`, `t`.`kichHoat` AS `kichHoat`, `t`.`dia_chi` AS `dia_chi`, `t`.`ho_ten_tai_khoan` AS `ho_ten_tai_khoan`, `t`.`so_tai_khoan` AS `so_tai_khoan`, `t`.`te_ngan_hang` AS `te_ngan_hang`, `t`.`user_old_id` AS `user_old_id`, `t`.`nguoi_phu_trach_id` AS `nguoi_phu_trach_id`, `t`.`auth_web` AS `auth_web`, `t`.`anhcancuoc` AS `anhcancuoc`, `qvu`.`vai_tro_id` AS `vai_tro_id`, `qvt`.`name` AS `vai_tro` FROM ((`qlcvsd_user` `t` left join `qlcvsd_vaitro_user` `qvu` on(`t`.`id` = `qvu`.`user_id`)) left join `qlcvsd_vai_tro` `qvt` on(`qvu`.`vai_tro_id` = `qvt`.`id`)) ;

